	@Inject
	public ClubGrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pClub = new ClubElements();
		this.pClubDescription = new ClubDescriptionElements();
		this.pTeam = new TeamElements();
		this.pPlayer = new PlayerElements();
		this.pOfficials = new OfficialsElements();
		this.pOfficial = new OfficialElements();
		this.pScoreKeeper = new ScoreKeeperElements();
		this.pUmpire = new UmpireElements();
		this.pMembers = new MembersElements();
		this.pMember = new MemberElements();
		this.pMemberStatus = new MemberStatusElements();
		this.eSTATUS = new STATUSElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("org.bpy.score.club.Club".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
	public TerminalsGrammarAccess getTerminalsGrammarAccess() {
		return gaTerminals;
	}

	
